import React from './react';
import ReactDOM from './react-dom';
import './chatbox.css';

const ChatPop = (props) => {

    let cssname = `container ${props.dark}`;
    let text = props.text;
    let imgsrc = props.imgs;

    return(
        <div class = {cssname}>
            <img src={imgsrc} alt="Avatar"/>
            <p>{text}</p>
            <span class="time-right">11:00</span>
        </div>
    );
};

export default ChatPop;
